import React from 'react';
import '../../css/style.css';
import '../../css/new.css';
import '../../css/globalstyle.css';
import '../../css/perfect-scrollbar.css';
import logo2 from '../../images/logo-2.png';
import logo from '../../images/logo-text.png'
import logotext from '../../images/logo-text.png';
import profile from '../../images/profile/pic1.jpg'

export default function Vnavbar() {

		function demo1() {
		var element = document.getElementById("hmb_icon");
		if (element.classList == "fa fa-arrow-left") {
			element.classList.replace('fa-arrow-left', 'fa-arrow-right');
			var x = document.getElementById('div-slide');
			var y = document.getElementById("left-slide");
			y.style.marginLeft = "-230px"
			y.style.transition = ".5s";
			x.style.width = '0px';
			x.style.transition = '0.5s';

		}
		else {
			element.classList.replace('fa-arrow-right', 'fa-arrow-left');
			var x = document.getElementById('div-slide');
			x.style.width = '255px';
			//x.style.display="block"
			x.style.transition = '0.5s';
			var y = document.getElementById("left-slide");
			y.style.marginLeft = "0px";
			y.style.transition = ".5s";
		}
	}
	function demo2() {
		var x = document.getElementById('div-slide');
		var y = document.getElementById("left-slide");
		x.style.width = '255px';
		x.style.transition = '0.5s';
		y.style.marginLeft = "0px";
		y.style.transition = ".5s";
	}
	
  return (
    <div>

         
    </div>
  )
}
